        <li><a href="/upload">Upload</a></li>
      </ul>
      {/* <div className='search-box'>
        <input type='text' placeholder='search' />
      </div> */}
      <div id="mobile" onc>
        <i  className={this.state.clicked ? 'fas fa-times': 'fas fa-bars'}></i>
        
      </div>
    </div>
  );
}
}
